INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (1, 0.029, 110, 105, 101, 1, 1.5, 160, 0, 122601, 0, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1, 1);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.014, 105, 111, 102, 2, 2.5, 120, 0, 122401, 1, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 3, 2);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.017, 110, 105, 103, 3, 2.5, 350, 1, 122501, 0, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 2, 3);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.016, 110, 105, 104, 4, 1.5, 130, 0, 107501, 1, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 3, 4);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (1, 0.014, 110, 105, 105, 5, 2.5, 160, 0, 107601, 0, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 1, 5);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.029, 120, 103, 106, 6, 3.5, 255, 1, 107801, 0, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 2, 6);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (1, 0.013, 120, 103, 107, 7, 3.5, 160, 0, 110601, 0, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 1, 7);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.014, 110, 103, 108, 8, 2.5, 350, 1, 110401, 0, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 2, 8);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.012, 105, 100, 109, 9, 1.5, 130, 0, 110501, 1, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 3, 9);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (1, 0.014, 105, 103, 110, 10, 2.5, 200, 0, 115701, 0, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 1, 10);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.071, 105, 103, 111, 11, 2.5, 350, 1, 113601, 0, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 2, 11);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.014, 120, 103, 112, 12, 1.5, 130, 0, 107901, 1, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 3, 12);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (1, 0.022, 110, 105, 113, 13, 1.5, 200, 0, 108001, 0, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 2, 13);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (1, 0.031, 110, 108, 114, 14, 2.5, 160, 0, 110301, 0, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 1, 14);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.036, 110, 105, 115, 15, 0.5, 130, 0, 107701, 1, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 1, 15);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.048, 110, 95, 116, 16, 3.5, 350, 1, 113101, 0, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 2, 16);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.043, 105, 105, 117, 17, 1.5, 130, 0, 113301, 1, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 3, 17);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.018, 105, 95, 118, 18, 1.5, 130, 0, 113201, 1, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 2, 18);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (1, 0.021, 110, 108, 119, 19, 2.5, 160, 0, 117001, 0, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 2, 19);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.036, 110, 105, 120, 20, 2.5, 255, 1, 113501, 0, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 1, 20);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.02, 105, 105, 121, 21, 2.5, 350, 1, 113401, 0, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 3, 21);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.018, 110, 105, 122, 22, 2.5, 130, 0, 110101, 1, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 1, 22);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (1, 0.03, 105, 111, 123, 23, 3.5, 160, 0, 110001, 0, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 3, 23);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.027, 110, 103, 124, 24, 1.5, 130, 0, 117201, 1, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1, 24);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (1, 0.02, 105, 108, 125, 25, 3.5, 160, 0, 117301, 0, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 2, 25);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.04, 110, 105, 126, 26, 2.5, 350, 1, 117401, 0, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 3, 26);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.009, 110, 105, 127, 27, 3.5, 350, 1, 117101, 0, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 1, 27);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.022, 120, 105, 128, 28, 3.5, 255, 1, 122901, 0, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 1, 28);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (0, 0.028, 110, 105, 129, 29, 2.5, 130, 0, 122801, 1, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 3, 29);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES (1, 0.023, 105, 108, 130, 30, 3.5, 130, 0, 122701, 0, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 2, 30);
